import Layout from '../components/Layout'

const Index = (props) => {
  return (
    <Layout>
      <div className='main'>
        <div className='main-intro'>
          Hi I'm Noah, <br />I like building stuff online.
        </div>
        <div className='sub-intro'>
          Check out my projects below, <br />
          and feel free to <a href='mailto:noahmaizels@protonmail.com'>get in touch</a>.
        </div>
      </div>
      <style jsx>{`
      .main-intro {
        font-size: 2.5rem;
        line-height: 2.7rem;
        margin-bottom: 15px;
      }  
      a {
        font-size: inherit;
        text-decoration: underline;
      }
      a:hover {
        cursor: pointer;
      }
      .sub-intro {
        font-size: 1.5rem;
        max-width: 400px;
      }
      .main {
        margin-top: 50px;
      }


      `}</style>
    </Layout>
  )
}

export default Index
